import React from 'react'
import { Row } from 'react-bootstrap'

export default function HomePage() {
  return (
    <div>
           
            <h1>Latest Products</h1>
            
                    <div>
                        <Row>
                            {products.map(product => (
                                <Col key={product._id} sm={12} md={6} lg={4} xl={3}>
                                    <Product product={product} />
                                </Col>
                            ))}
                        </Row>
                        
                    </div>
            
        </div>

  )
}
